import axios from 'axios';

export default function Appetizers() {
    axios.get(`https://www.jsonkeeper.com/b/MDXW`)
        .then((response) => {
            let data = response.data
            console.log(data);

            return (
                <div className='container'>
                    <div className='row'>
                        <div className='col'>
                            {data[1]}
                        </div>
                    </div>
                </div>
            )
        })
}
